(37, 'Pornographie', 'Verboten in allen muslimischen L&auml;ndern beschr&auml;nkt und in den meisten anderen L&auml;ndern.', 'de', 'porno.png'),
(38, 'Sprays...', 'Pas de bo&icirc;tes pressuris&eacute;es de tout type comme fixatif, cr&egrave;me &agrave; raser et bombe anti-insecte.', 'fr', 'spray.png'),
(39, 'Pressurized Cans', 'No pressurized cans of any type like hairspray, shaving cream and bug spray. ', 'en', 'spray.png'),
(40, 'Druckdosen', 'Keine Druckdosen jeglicher Art wie Haarspray, Rasierschaum und Insektenspray.', 'de', 'spray.png'),
(41, 'Equipement tactique', 'Lunettes de vision nocturne, lock-pickers, des port&eacute;es optiques laser et menottes.', 'fr', 'optique.png'),
(42, 'Tactical Equipment', 'Night-vision goggles, lock-pickers, optical scopes, laser sites and handcuffs. ', 'en', 'optique.png'),
(43, 'Tactical Equipment', 'Nachtsichtger&auml;te, Lock-Picker, optische Bereiche, Laser-Sites und Handschellen.', 'de', 'optique.png'),
