INSERT INTO `banned_pd_spe` (`bann_spe_id`, `bann_spe_contenu_fr`, `bann_spe_contenu_en`, `bann_spe_contenu_de`, `bann_spe_contenu_es`, `bann_spe_contenu_it`, `bann_spe_contenu_pt`, `bann_spe_contenu_nl`, `bann_spe_contenu_da`, `bann_spe_contenu_sv`, `bann_spe_contenu_no`, `bann_spe_langue`) VALUES
(1, '<li>Antiquit&eacute;s (s&eacute;cable et / ou fragile)</li>\n\n<li>Bijoux (contenant des m&eacute;taux pr&eacute;cieux, pierres)</li>\n\n\n\n<li>Horloges / montres\n</li>\n\n<li>Mat&eacute;riel de communication\n\n\n</li><li>Disque compact\n\n\n</li><li>Logiciel\n\n\n</li><li>Disquettes\n\n</li>\n<li>Jeux &eacute;lectroniques\n\n\n</li><li>Tissus et des &eacute;chantillons de tissus\n\n\n</li><li>Appareils de jeu (casino)\n\n</li>\n<li>Echantillons de grains\n</li>\n\n<li>Bijoux, costume\n\n</li>\n<li>Maroquinerie\n\n\n</li><li>Appareil de mesure\n\n\n</li><li>Effets personnels\n\n\n</li><li>T&eacute;l&eacute;phones / modems\n</li>\n\n<li>Cartes &agrave; jouer\n</li>\n<li>Equipements Radar\n\n\n</li><li>Echantillons, textile\n\n\n</li><li>Pi&egrave;ces de rechange des navires\n\n\n</li><li>Chaussures\n\n</li>\n<li>Des &eacute;chantillons de sol\n</li>', '<li>Antiques (breakable and/or fragile)\n\n</li><li>Jewelry (Containing Precious Metals, Stones)\n\n</li>\n<li>Clocks/watches\n\n</li><li>Communications equipment \n\n</li><li>Compact disc</li> \n\n<li>Computer software \n\n</li><li>Diskettes \n\n</li><li>Electronic games\n\n</li><li>Fabrics & fabric samples </li>\n\n<li>Gambling devices \n\n</li><li>Grain samples \n</li>\n<li>Jewellery, costume \n\n\n</li><li>Measuring apparatus</li>\n\n<li>Personal Effects \n\n</li><li>Phones/modems</li> \n\n<li>Playing cards \n\n</li><li>Radar equip.-transmitters/receivers</li> \n\n<li>Samples, textile \n\n</li><li>Ship spares </li>\n\n<li>Shoes \n\n</li><li>Soil samples</li> \n', '<li> Antiques (zerbrechliche und / oder zerbrechlich)\n</li> <li> Jewelry (Edelmetalle enthalten, Stones)\n</li>\n<li> Uhren / Uhren\n</li> <li> Kommunikationstechnik\n</li> <li> Compact Disc </li>\n<li> Computer-Software\n</li> <li> Disketten\n</li> <li> Elektronische Spiele\n</li> <li> Fabrics & Stoffmuster </li>\n<li> Gambling-Ger&auml;te\n</li> <li> Grain Proben</li>\n<li> Schmuck, Kost&uuml;m\n</li> <li> Messger&auml;te </li>\n<li> Personal Effects\n</li> <li> Phones / Modems </li>\n<li> Spielkarten\n</li> <li> Radar equip.-transmitters/receivers </li>\n<li> Proben-, Textil-\n</li> <li> Schiff Ersatzteile </li>\n<li> Schuhe\n</li> <li> Bodenproben </li>', '', '', '', '', '', '', '', 'fr'),
(2, '<li>Produits d''origine animale</li>\n<li>Les peaux d''animaux</li>\n<li>Antiquit&eacute;s (s&eacute;cable et / ou fragile)</li>\n<li>Bijoux (contenant des m&eacute;taux pr&eacute;cieux, pierres)</li>\n<li>Noix: noisettes, arachides, noix du Br&eacute;sil, pistaches, figues</li>\n<li>Des croix gamm&eacute;es</li>\n<br />\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis vers l''Allemagne sont &eacute;num&eacute;r&eacute;s ci-dessous. \n<br />\n<li>Antiquit&eacute;s</li>\n<li>caf&eacute;</li>\n<li>Logiciel</li>\n<li>Disquettes</li>\n<li>M&eacute;dicaments</li>\n<li>Tissus et des &eacute;chantillons de tissus</li>\n<li>Denr&eacute;es alimentaires</li>\n<li>Fournitures m&eacute;dicales / dentaires et &eacute;quipements</li>\n<li>Microfiche & microfilms</li>\n<li>Effets personnels</li>\n<li>&eacute;chantillons, textile</li>\n<li>Nuancier</li>\n<li>Articles textiles</li>\n<li>Tabac</li>', '<li> animal products </li>\n<li> animal skins </li>\n<li> Antiques (breakable and / or fragile) </li>\n<li> Jewelry (containing precious metals, stones) </li>\n<li> Nuts: hazelnuts, peanuts, Brazil nuts, pistachios, figs </li>\n<li> swastikas </li>\n<br />\nRestricted Commodities when importing from the United States to Germany are listed below.\n<br />\n<li> Antiques </li>\n<li> coffee </li>\n<li> Software </li>\n<li> Disks </li>\n<li> Drugs </li>\n<li> tissues and tissue samples </li>\n<li> Food </li>\n<li> Medical Supplies / dental equipment </li>\nMicrofiche & microfilm <li> </li>\n<li> Personal Effects </li>\n<li> samples, textile </li>\n<li> Swatches </li>\n<li> Textile </li>\n<li> Tobacco </li>', '<li> tierische Produkte </li>\n<li> Tierh&auml;uten </li>\n<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\n<li> Jewelry (Edelmetalle enthalten, Steine) </li>\n<li> N&uuml;sse: Haseln&uuml;sse, Erdn&uuml;sse, Paran&uuml;sse, Pistazien, Feigen </li>\n<li> Hakenkreuzen </li>\n<br />\nRestricted Commodities beim Import aus den Vereinigten Staaten nach Deutschland sind unten aufgef&uuml;hrt.\n<br />\n<li> Antiquit&auml;ten </li>\n<li> Kaffee </li>\n<li> Software </li>\n<li> Disks </li>\n<li> Drogen </li>\n<li> Gewebe und Gewebeproben </li>\n<li> Food </li>\n<li> Medical Supplies / zahnmedizinische Ger&auml;te </li>\nMikrofiche & Mikrofilm <li> </li>\n<li> Personal Effects </li>\n<li> Proben, Textil </li>\n<li> Farbfelder </li>\n<li> Textile </li>\n<li> Tobacco </li>\n', '', '', '', '', '', '', '', 'de'),
(3, '<li>Antiquit&eacute;s (s&eacute;cable et / ou fragile)</li>\n<li>Bijoux (contenant des m&eacute;taux pr&eacute;cieux, pierres)</li>\n<br />\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en Suisse sont list&eacute;s ci-dessous. \n<br />\n<li>boissons alcoolis&eacute;es</li>\n<li>produits d''origine animale</li>\n<li>M&eacute;dicaments</li>\n<li>Tissus et des &eacute;chantillons de tissus</li>\n<li>denr&eacute;es alimentaires</li>\n<li>equip.-transmitters/receivers Radar</li>\n<li>&eacute;chantillons, textile</li>\n<li>articles textiles</li>', '<li> Antiques (breakable and / or fragile) </li>\n<li> Jewelry (containing precious metals, stones) </li>\n<br />\nRestricted Commodities when importing from the United States in Switzerland are listed below. \n<br />\n<li> alcoholic beverages </li>\n<li> animal products </li>\n<li> Drugs </li>\n<li> tissues and tissue samples </li>\n<li> food </li>\n<li> equip.-transmitters/receivers Radar </li>\n<li> samples, textile </li>\n<li> textiles </li>', '<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\n<li> Jewelry (Edelmetalle enthalten, Steine) </li>\n<br />\nRestricted Commodities beim Import aus den Vereinigten Staaten in der Schweiz sind im Folgenden aufgef&uuml;hrt. \n<br />\n<li> alkoholische Getr&auml;nke </li>\n<li> tierische Produkte </li>\n<li> Drogen </li>\n<li> Gewebe und Gewebeproben </li>\n<li> food </li>\n<li> equip.-transmitters/receivers Radar </li>\n<li> Proben, Textil </li>\n<li> Textilien </li>\n\n', '', '', '', '', '', '', '', 'ch'),
(4, '<li>Antiquit&eacute;s(s&eacute;cable et / ou fragile) </li>\n<li>Bijoux (contenant des m&eacute;taux pr&eacute;cieux, pierres) </li>', '<li>Antiques (breakable and/or fragile) </li>\n<li>Jewelry (Containing Precious Metals, Stones)</li>', '<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\r\n<li> Jewelry (Edelmetalle enthalten, Stones) </li>', '', '', '', '', '', '', '', 'it'),
(5, '<li>Antiquit&eacute;s (s&eacute;cable et / ou fragile) </li>\n<li>Drogues</li>\n<li>Dispositifs de jeux de hasard </li>\n<li>Bijoux (contenant des m&eacute;taux pr&eacute;cieux, pierres) </li>\n<li> M&eacute;latonine </li>\n<li> Jeu de cartes </li>\n<li> Cartilage de Requin </li>\n<br />\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en Espagne sont &eacute;num&eacute;r&eacute;s ci-dessous. <br />\n\n<li> Boissons alcoolis&eacute;es </li>\n<li>Les peaux d''animaux </li>\n<li>Produits chimiques , non dangereux </li>\n<li> Cosm&eacute;tiques </li>\n<li> Denr&eacute;es alimentaires </li>\n<li>Bijoux, costume </li>\n<li> effets personnels </li>\n<li>pi&egrave;ces de rechange des navires </li>\n<li> Chaussures </li>\n<li> Equipement de sport </li>\n<li>Mat&eacute;riel de t&eacute;l&eacute;communications</li>\n<li> Articles textiles </li>', '<li>Antiques (breakable and/or fragile) </li>\n<li>Drugs: non-prescription </li>\n<li>Gambling devices </li>\n<li>Jewelry (Containing Precious Metals, Stones) </li>\n<li>Melatonin </li>\n<li>Playing cards </li>\n<li>Shark Cartilage </li>\n<br />\nRestricted Commodities when importing from the US into Spain are listed below. <br />\n<li>Alcoholic beverages </li>\n<li>Animal skins </li>\n<li>Chemicals, non-hazardous </li>\n<li>Cosmetics </li>\n<li>Foodstuffs </li>\n<li>Jewellery, costume </li>\n<li>Personal Effects </li>\n<li>Ship spares </li>\n<li>Shoes </li>\n<li>Sports equipment </li>\n<li>Telecommunications equipment </li>\n<li>Textile articles </li>', '<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\n<li> Drogen: nicht verschreibungspflichtige </li>\n<li> Gambling Ger&auml;te </li>\n<li> Jewelry (Edelmetalle enthalten, Stones) </li>\n<li> Melatonin </li>\n<li> Spielkarten </li>\n<li> Haifischknorpel </li>\n<br />\nRestricted Commodities beim Import aus den USA in Spanien sind unten aufgef&uuml;hrt. \n<br />\n<li> Alkoholische Getr&auml;nke </li>\n<li> Tierh&auml;ute </li>\n<li> Chemicals, Nicht-Ex </li>\n<li> Cosmetics </li>\n<li> Drugs: prescription </li>\n<li> Lebensmittel </li>\n<li> Schmuck, Kost&uuml;m </li>\n<li> Personal Effects </li>\n<li> Schiff Ersatzteile </li>\n<li> Schuhe </li>\n<li> Sportger&auml;te </li>\n<li> Fernmeldeanlagen </li>\n<li> Textile Artikel </li>', '', '', '', '', '', '', '', 'es'),
(6, '<li>Antiquit&eacute;s (s&eacute;cable et / ou fragile)</li>\n<li>Bijoux (contenant des m&eacute;taux pr&eacute;cieux, pierres)</li>\n<br />\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en Autriche sont &eacute;num&eacute;r&eacute;s ci-dessous.\n<br />\n<li>Boissons alcoolis&eacute;es</li>\n<li>Produits d''origine animale</li>\n<li>Tissus et des &eacute;chantillons de tissus</li>\n<li>Denr&eacute;es alimentaires</li>\n<li>Equip.-transmitters/receivers Radar</li>\n<li>Echantillons, textile</li>\n<li>Articles textiles</li>', '<li>Antiques (breakable and/or fragile) </li>\n<li>Jewelry (Containing Precious Metals, Stones) </li>\n<br />\nRestricted Commodities when importing from the US into Austria are listed below. \n<br />\n<li>Alcoholic beverages </li>\n<li>Animal products </li>\n<li>Fabrics & fabric samples </li>\n<li>Foodstuffs </li>\n<li>Radar equip.-transmitters/receivers </li>\n<li>Samples, textile </li>\n<li>Textile articles </li>\n', '<li>Antiquit&auml;ten (zerbrechlich und / oder zerbrechlich)</li>\n<li>Schmuck (Edelmetalle enthalten, Stones)</li>\n<br />\nRestricted Commodities beim Import aus den USA in &ouml;sterreich sind unten aufgef&uuml;hrt.\n<br />\n<li>Alkoholische Getr&auml;nke</li>\n<li>Tierische Erzeugnisse</li>\n<li>Fabrics & Stoffmuster</li>\n<li>Lebensmittel</li>\n<li>Radar equip.-transmitters/receivers</li>\n<li>Proben-, Textil-</li>\n<li>Textilwaren</li>\n', '', '', '', '', '', '', '', 'au'),
(7, '<li>Antiquit&eacute;s  (s&eacute;cable et / ou fragile) </li>\n<li>Bijoux  (contenant des m&eacute;taux pr&eacute;cieux, pierres) </li>\n<li>M&eacute;dicaments  pour les particuliers </li>\n<br />\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en Pays-Bas sont &eacute;num&eacute;r&eacute;s ci-dessous.<br />\n\n<li>Produits d''origine animale  </li>\n<li>Les peaux d''animaux  </li>\n<li>Echantillon  Hydrocarbures de soute (pour analyse) </li>\n<li>Les ch&egrave;ques , caissier (NI) </li>\n<li>Caf&eacute; </li>\n<li>Denr&eacute;es alimentaires </li>\n<li>Effets personnels </li>\n<li>Des &eacute;chantillons de sol  </li>\n<li>Articles textiles </li>', '<li>Antiques (breakable and/or fragile) </li>\n<li>Jewelry (Containing Precious Metals, Stones) </li>\n<li>Medicines for private persons </li>\n<br />\nRestricted Commodities when importing from the US into Netherlands are listed below. \n<br />\n<li>Animal products </li>\n<li>Animal skins </li>\n<li>Bunker oil sample (for analysis) </li>\n<li>Cheques, cashier (NI) </li>\n<li>Coffee </li>\n<li>Foodstuffs </li>\n<li>Personal Effects </li>\n<li>Soil samples </li>\n<lI>Textile articles </li>', '<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\n<li> Jewelry (Edelmetalle enthalten, Stones) </li>\n<li> Arzneimittel für Privatpersonen </li>\n<br />\nRestricted Commodities beim Import aus den USA in Deutschland sind unten aufgef&uuml;hrt.\n<br />\n<li> Tierische Produkte </li>\n<li> Tierh&auml;ute </li>\n<li> Bunker Olprobe (zur Analyse) </li>\n<li> Cheques, Kassierer (NI) </li>\n<li> Coffee </li>\n<li> Lebensmittel </li>\n<li> Personal Effects </li>\n<li> Bodenproben </li>\n<li> Textile Artikel </li>', '', '', '', '', '', '', '', 'nl'),
(8, '<li>Peaux d''animaux  </li>\n<li>Antiquit&eacute;s  (s&eacute;cable et / ou fragile) </li>\n<li>Bijoux  (contenant des m&eacute;taux pr&eacute;cieux, des pierres) </li>\n<br />\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis au Danemark sont &eacute;num&eacute;r&eacute;s ci-dessous.\n<br />\n<li>Produits d''origine animale  </li>\n<li>Produits chimiques , non dangereux </li>\n<li> Coton </li>\n<li>Graine de coton </li>\n<li>Extincteur </li>\n<li>Les &eacute;chantillons de grains  </ li>\n<li>Effets personnels </li>\n<li>Echantillons de sol  </ li>', '<li>Animal skins </li>\n<li>Antiques (breakable and/or fragile) </li>\n<li>Jewelry (Containing Precious Metals, Stones) </li>\n<li>Peaux d''animaux  </li>\n<li>Antiquit&eacute;s  (s&eacute;cable et / ou fragile) </li>\n<li>Bijoux  (contenant des m&eacute;taux pr&eacute;cieux, des pierres) </li>\n<br />\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis au Danemark sont &eacute;num&eacute;r&eacute;s ci-dessous.\n<br />\n\n<li>Produits d''origine animale  </li>\n<li>Produits chimiques , non dangereux </li>\n<li> Coton </li>', '<li> Tierh&auml;ute </li>\n<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\n<li> Jewelry (Edelmetalle enthalten, Stones) </li>\n<br />\n\nRestricted Commodities beim Import aus den USA in D&auml;nemark sind unten aufgef&uuml;hrt.\n<br />\n\n<li> Tierische Produkte </li>\n<li> Chemicals, Nicht-Ex </li>\n<li> Baumwolle </li>\n<li> Baumwollsamen </li>\n<li> Feuerl&ouml;scher </li>\n<li> Grain Proben </li>\n<li> Personal Effects </li>\n<li> Bodenproben </li>', '', '', '', '', '', '', '', 'da'),
(9, '<li>Antiquit&eacute;s  (s&eacute;cable et / ou fragile) </li>\n<li>Bijoux  (contenant des m&eacute;taux pr&eacute;cieux, pierres) </li>\n<br />\n\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en Su&egrave;de sont &eacute;num&eacute;r&eacute;s ci-dessous.\n<br />\n\n<li>Boissons alcoolis&eacute;es </li>\n<li>Produits d''origine animale  </li>\n<li>Disque compact </li>\n<li>Denr&eacute;es alimentaires </li>\n<li>Pi&egrave;ces , lave & &eacute;lectronique </li>\n<li>Effets personnels </li>\n<li>Les &eacute;chantillons , textile </li>\n<li>Articles textiles </li>\n<li>Tabac </li>', '<li>Antiques (breakable and/or fragile) </li>\n<li>Jewelry (Containing Precious Metals, Stones) </li>\n<br />\n\nRestricted Commodities when importing from the US into Sweden are listed below. \n<br />\n\n<li>Alcoholic beverages </li>\n<li>Animal products </li>\n<li>Compact disc </li>\n<li>Foodstuffs </li>\n<li>Parts, machine & electronic </li>\n<li>Personal Effects </li>\n<li>Samples, textile </li>\n<li>Textile articles </li>\n<li>Tobacco </li>', '<li> Antiques (zerbrechliche und / oder zerbrechlich) </ li>\r\n<li> Jewelry (Edelmetalle enthalten, Stones) </ li>\r\n\r\nRestricted Commodities beim Import aus den USA in Schweden sind unten aufgef&uuml;hrt.\r\n\r\n<li> Alkoholische Getr&auml;nke </ li>\r\n<li> Tierische Produkte </ li>\r\n<li> Compact Disc </ li>\r\n<li> Lebensmittel </ li>\r\n<li> Teile, Maschinen und elektronische </ li>\r\n<li> Personal Effects </ li>\r\n<li> Samples, Textil </ li>\r\n<li> Textile Artikel </ li>\r\n<li> Tobacco </ li>', '', '', '', '', '', '', '', 'sv'),
(10, '<li>Antiquit&eacute;s  (s&eacute;cable et / ou fragile) </li>\r\n<li>Graines de coton  </li>\r\n<li>Bijoux  (contenant des m&eacute;taux pr&eacute;cieux, pierres) </li>\r\n<br />\r\nProduits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en Belgique sont &eacute;num&eacute;r&eacute;s ci-dessous. <br />\r\n<li>Produits d''origine animale  </li>\r\n<li>Les peaux d''animaux  </li>\r\n<li>Extincteurs  </li>\r\n<li>Denr&eacute;es alimentaires </li>\r\n<li>Isopropanol </li>\r\n<li>Maroquinerie  </li>\r\n<li>Effets personnels </li>\r\n<li>Pi&egrave;ces de rechange des navires  </li>\r\n<li>Des &eacute;chantillons de sol  </li>\r\n<li>Subs . cont''g de sodium / calc. cyclamate </li>\r\n<li>Articles textiles </li>\r\n<li>Tabac </li>\r\n', '<li>Antiques (breakable and/or fragile) </li>\r\n<li>Cotton seed </li>\r\n<li>Jewelry (Containing Precious Metals, Stones) </li>\r\n<br />\r\nRestricted Commodities when importing from the US into Belgium are listed below. <br />\r\n<li>Animal products </li>\r\n<li>Animal skins </li>\r\n<li>Fire extinguishers </li>\r\n<li>Foodstuffs </li>\r\n<li>Isopropanol </li>\r\n<li>Leather goods </li>\r\n<li>Personal Effects </li>\r\n<li>Ship spares </li>\r\n<li>Soil samples </li>\r\n<li>Subs. cont''g sodium/calc. cyclamate </li>\r\n<li>Textile articles </li>\r\n<li>Tobacco </li>\r\n', '<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\r\n<li> Baumwollsamen </li>\r\n<li> Jewelry (Edelmetalle enthalten, Stones) </li>\r\n<br />\r\nRestricted Commodities beim Import aus den USA in Belgien sind unten aufgef&uuml;hrt. <br />\r\n<li> Tierische Produkte </li>\r\n<li> Tierh&auml;ute </li>\r\n<li> Feuerlöscher </li>\r\n<li> Lebensmittel </li>\r\n<li> Isopropanol </li>\r\n<li> Lederwaren </li>\r\n<li> Personal Effects </li>\r\n<li> Schiff Ersatzteile </li>\r\n<li> Bodenproben </li>\r\n<li> Subs. cont''g Natrium / calc. Cyclamat </li>\r\n<li> Textile Artikel </li>\r\n<li> Tobacco </li>', '', '', '', '', '', '', '', 'be'),
(11, '<li>Antiquit&eacute;s  (s&eacute;cable et / ou fragile) </li>\r\n<li>Bijoux  (contenant des m&eacute;taux pr&eacute;cieux, pierres) </li>\r\n<br />\r\n<li>Produits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en Norv&egrave;ge sont &eacute;num&eacute;r&eacute;s ci-dessous. <br />\r\n<li>Boissons alcoolis&eacute;es </li>\r\n<li>Echantillon  Hydrocarbures de soute (pour analyse) </li>\r\n<li>Denr&eacute;es alimentaires </li>\r\n<li>Les &eacute;chantillons de grains  </li>\r\n<li>Pi&egrave;ces de rechange des navires  </li>\r\n<li>Mat&eacute;riel de t&eacute;l&eacute;communications  </li>\r\n<li>Tabac </li>', '<li>Antiques (breakable and/or fragile) </li>\r\n<li>Jewelry (Containing Precious Metals, Stones) </li>\r\n<br />\r\nRestricted Commodities when importing from the US into Norway are listed below. <br />\r\n<li>Alcoholic beverages </li>\r\n<li>Bunker oil sample (for analysis) </li>\r\n<li>Foodstuffs </li>\r\n<li>Grain samples </li>\r\n<li>Ship spares </li>\r\n<li>Telecommunications equipment </li>\r\n<li>Tobacco </li>', '<li> Antiques (zerbrechliche und / oder zerbrechlich) </li>\r\n<li> Jewelry (Edelmetalle enthalten, Stones) </li>\r\n<br />\r\nRestricted Commodities beim Import aus den USA in Norwegen sind unten aufgef&uuml;hrt. <br />\r\n<li> Alkoholische Getr&auml;nke </li>\r\n<li> Bunker Olprobe (zur Analyse) </li>\r\n<li> Lebensmittel </li>\r\n<li> Grain Proben </li>\r\n<li> Schiff Ersatzteile </li>\r\n<li> Fernmeldeanlagen </li>\r\n<li> Tobacco </li>\r\n', '', '', '', '', '', '', '', 'no'),
(12, '<li>Antiquit&eacute;s , oeuvres d''art et objets d''art d''une valeur individuelle de plus de 50.000 &euro; </li>\r\n<li>Banderoles/autocollants fiscaux </li>\r\n<li>Devises et argent (y compris, mais sans s''y limiter, les billets de banque, monnaies, cartes vierges ou de cr&eacute;dit, ch&egrave;ques en blanc, billets de loterie, de l''argent ou des mandats-poste, des cartes de t&eacute;l&eacute;phone pr&eacute;pay&eacute;es , billets, ch&egrave;ques de voyage, ch&egrave;ques et des timbres / jetons non utilis&eacute;s) </li>\r\n<li>Imitation d''armes &agrave; feu, armes-jouets, armes, d''engins explosifs ou de munitions </li>\r\n<li>Insectes , larves, nymphes, etc </li>\r\n<li>Piles au lithium en vrac </li>\r\n<li>Mat&eacute;riel d''imprimerie  contenant de l''encre ou de cartouches de toner avec poids exc&eacute;dant 0,5 kg </li>\r\n\r\n<br /> produits restreints lors de l''importation &agrave; partir des &eacute;tats-Unis en France sont list&eacute;s ci-dessous. <br />\r\n\r\n<li>Bijouterie fantaisie - max de 250 &pound; par article et &pound; 1,000 par envoi. </li>\r\n<li>Vetements de marque , habillement, accessoires - &euro; 250 maximum de 1000 euros par livraison </li>\r\n<li>Les m&eacute;dicaments et les produits pharmaceutiques  - maximum de 1.000 livres sterling par envoi </li>\r\n<li>Articles &eacute;lectroniques - maximum de 2 par envoi </li>\r\n<li>Bijoux (contenant des m&eacute;taux pr&eacute;cieux, pierres) </li>\r\n<li>Ordinateurs portables  - maximum de 1 par envoi </li>\r\n<lI>T&eacute;l&eacute;phones mobiles - maximum de 2 par envoi </li>\r\n<li>Tabac, produits du tabac en vrac et feuilles pr&eacute;-cigarettes roul&eacute;es </li>\r\n<li>Armes-jouets </li>\r\n<li>Montres </li>', '<li> Antiques, art and artifacts of an individual value of more than 50,000 &euro;</ li>\r\n<li> Banners / tax stickers </ li>\r\n<li> Currencies and money (including, but not limited to, bank notes, coins, blank cards or credit cards, blank checks, lottery tickets, money or money mail, prepaid phone cards, tickets, traveler''s checks, checks and stamps / unused tokens) </ li>\r\n<li> Imitation firearms, toy guns, weapons, explosives or ammunition </ li>\r\n<li> insects, larvae, nymphs, etc. </ li>\r\n<li> loose lithium batteries </ li>\r\n<li> printing equipment containing ink or toner cartridges weighing more than 0.5 kg </ li>\r\n\r\n<br /> restricted products during import from the United States in France are listed below. <br />\r\n\r\n<li> Costume jewelery - max &pound; 250 and £ 1,000 per item per shipment. </ li>\r\n<li> Clothing brand, clothing, accessories - 250 &euro; maximum of 1000 euros per delivery </ li>\r\n<li> drugs and pharmaceuticals - maximum of &pound; 1,000 per item </ li>\r\n<li> electronic products - maximum of 2 per item </ li>\r\n<li> Jewelry (containing precious metals, stones) </ li>\r\n<li> Laptops - maximum of 1 per item </ li>\r\n<li> Phones - maximum of 2 per item </ li>\r\n<li> Tobacco, tobacco leaves in bulk and pre-rolled cigarettes </ li>\r\n<li> Toy guns </ li>\r\n<li> Watches </ li>', '<li> Kunst, Antiquit&auml;ten und Artefakte eines einzelnen Wert von mehr als € 50.000 </ li>\r\n<li> Banner / Steuern Aufkleber </ li>\r\n<li> W&auml;hrungen und Geld (einschlie&szlig;lich, aber nicht beschr&auml;nkt auf, Banknoten, M&uuml;nzen, Blanko-Karten oder Kreditkarten, Blankoschecks, Lotterielose, Geld oder Geldeswert begrenzt Mail, Prepaid-Telefonkarten, Fahrkarten, Reiseschecks, Schecks und Briefmarken / unbenutzt Token) </ li>\r\n<li> Imitationen von Feuerwaffen, Spielzeugpistolen, Waffen, Sprengstoff und Munition </ li>\r\n<li> Insekten, Larven, Nymphen, usw. </ li>\r\n<li> losen Lithium-Batterien </ li>\r\n<li> Druckmaschinen mit Tintenpatronen oder Tonerkartuschen einem Gewicht von mehr als 0,5 kg </ li>\r\n\r\n<br /> eingeschr&auml;nkten Produkte beim Import aus den Vereinigten Staaten in Frankreich sind unten aufgef&uuml;hrt. <br />\r\n\r\n<li> Modeschmuck - max &pound; 250 und &pound; 1.000 pro Artikel pro Sendung. </ li>\r\n<li> Kleidung Marke, Kleidung, Acce&szlig;oires - &euro; 250 maximal 1000 &pound; pro Lieferung </ li>\r\n<li> Drogen und Pharmazeutika - maximal 1.000 &pound; pro Artikel </ li>\r\n<li> elektronischen Produkten - maximal 2 pro Artikel </ li>\r\n<li> Jewelry (Edelmetalle enthalten, Steine) </ li>\r\n<li> Laptops - maximal 1 pro Artikel </ li>\r\n<li> Phones - maximal 2 pro Artikel </ li>\r\n<li> Tabak, Tabakbl&auml;tter in der Ma&szlig;e und pre-Zigaretten </ li>\r\n<li> Spielzeugpistolen </ li>\r\n<li> Uhren </ li>', '', '', '', '', '', '', '', 'en');
