(2, '<img src=\\"http://www.from-us.com/images/bann.jpg\\" width=\\"700\\" height=\\"89\\" />\r\n<br />\r\n<div style=\\"width:700px;\\">	\r\n<div style=\\"text-align: left;\\">\r\n<font face=\\"arial\\" size=\\''2\\''><b>%prenom% %nom%</b></font></div>	\r\n<div style=\\"text-align: justify;\\">\r\n<font face=\\"arial\\" size=\\''2\\''>Vous venez de confirmer votre inscription sur from-us.com <br />    Dans ce mail, nous vous envoyons votre num&eacute;ro de boite qui vous permettra de commander facilement sur notre site. Ce num&eacute;ro est unique et vous sera demand&eacute; &agrave de nombreuses occasions -- Conservez le pr&eacute;cieusement !!!\r\n<br />\r\nNum&eacute;ro de boite : %suite%<br />\r\n\r\n    En cas de soucis d''activation de votre compte, vous pouvez nous joindre au XX XX XX XX XX<br />\r\n</font>\r\n</div>\r\n<br />\r\n<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''>Pour toute questions ou toute aide sur les services offerts ainsi que sur le site, merci de contacter par email notre service technique dans la rubrique <a href=\\''http://www.from-us.com/contact.html\\''>CONTACT</a> en indiquant vos Nom, Pr&eacute;nom et adresse Email afin que nos services puissent traiter votre question dans les plus brefs d&eacute;lais.</font></div><br />\\r\\n	<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''><b>IMPORTANT:</b> Si vous ne vous &ecirc;tes jamais enregistr&eacute;(e) sur notre site internet, merci de nous contacter en pr&eacute;cisant qu\\''une personne, par erreur ou de fa&ccedil;on mal attentionn&eacute;e, a usurp&eacute; votre identit&eacute; au <b>XX.XX.XX.XX.XX</b></font></div>\\r\\n	<br />\\r\\n	<br />\\r\\n	<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''>Nous vous remercions d\\''avoir choisi from-US.com, en esp&eacute;rant vous revoir prochainement sur notre site.<br />\\r\\n	<a href=\\"http://www.from-us.com\\">http://www.from-us.com</a></font></div>\\r\\n	\\r\\n</div>', 'suite_inscr', 'fr'),
(3, '<img src=\\"http://www.from-us.com/images/bann.jpg\\" width=\\"700\\" height=\\"89\\" />\r\n<br />\r\n<div style=\\"width:700px;\\">	\r\n<div style=\\"text-align: left;\\">\r\n<font face=\\"arial\\" size=\\''2\\''><b>%prenom% %nom%</b></font></div>	\r\n<div style=\\"text-align: justify;\\">\r\n<font face=\\"arial\\" size=\\''2\\''>Vous venez de confirmer votre inscription sur from-us.com <br />    Dans ce mail, nous vous envoyons un r&eacute;capitulatif de vos services sur le site :<br />\r\n\r\n<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''>Pour toute questions ou toute aide sur les services offerts ainsi que sur le site, merci de contacter par email notre service technique dans la rubrique <a href=\\''http://www.from-us.com/contact.html\\''>CONTACT</a> en indiquant vos Nom, Pr&eacute;nom et adresse Email afin que nos services puissent traiter votre question dans les plus brefs d&eacute;lais.</font></div><br />\\r\\n	<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''><b>IMPORTANT:</b> Si vous ne vous &ecirc;tes jamais enregistr&eacute;(e) sur notre site internet, merci de nous contacter en pr&eacute;cisant qu\\''une personne, par erreur ou de fa&ccedil;on mal attentionn&eacute;e, a usurp&eacute; votre identit&eacute; au <b>XX.XX.XX.XX.XX</b></font></div>\\r\\n	<br />\\r\\n	<br />\\r\\n	<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''>Nous vous remercions d\\''avoir choisi from-US.com, en esp&eacute;rant vous revoir prochainement sur notre site.<br />\\r\\n	<a href=\\"http://www.from-us.com\\">http://www.from-us.com</a></font></div>\\r\\n	\\r\\n</div>', 'sous_inscr', 'fr'),
(4, '<img src=\\"http://www.from-us.com/images/bann.jpg\\" width=\\"700\\" height=\\"89\\" />\r\n<br />\\r\\n\r\n\r\n<div style=\\"width:700px;\\">\\r\\n\r\n\r\n\r\n<div style=\\"text-align: justify;\\">\\r\\n\r\n\r\n<font face=\\"arial\\" size=\\''2\\''>----------------------------------------------------------\\r\\nIMPORTANT : Il est impératif de ne pas modifier l\\''objet de\\r\\nce mail car il contient un numéro de dossier garantissant\\r\\nune gestion rapide et efficace de nos échanges.\\r\\n----------------------------------------------------------\\r\\n\\r\\nFélicitations, votre commande a bien été enregistrée et nous vous en remercions.\\r\\n\\r\\n%infos%\\r\\n\\r\\nMode de paiement\\r\\n----------------------------------------------------------\\r\\nVirement bancaire\\r\\n\\r\\nNous vous remercions d\\''effectuer votre virement à la banque ci-dessous.\\r\\nPour traiter rapidement votre commande à la réception du virement, merci de bien vouloir indiquer votre numéro de commande.\\r\\nAttention : sans réception de votre virement dans les 10 jours, votre commande sera automatiquement annulée.\\r\\n\\r\\nBanque Populaire d''alsace\\r\\n\\r\\nCode Banque      : 17607\\r\\nCode Guichet     : 00001\\r\\nNuméro de compte : 70213736161\\r\\nClé              : 61\\r\\nDomiciliation    : BPALS MULH. BOURTZWILLER\\r\\n\\r\\nIDENTIFICATION INTERNATIONALE :\\r\\nIBAN : FR76 1760 7000 0170 2137 3616 161\\r\\nBIC-ADRESSE SWIFT : CCBPFRPPSTR\\r\\n\\r\\nTITULAIRE :\\r\\nSAS FROM-US.com\\r\\n65 rue Jean Monnet\\r\\n68100 MULHOUSE\\r\\n----------------------------------------------------------\\r\\n\\r\\nFrom-US.com vous remercie pour l\\''intérêt que vous portez à ses produits. \\r\\n\\r\\nPour toute question sur votre commande, veuillez contacter notre service clients</font>	\\r\\n</div>', 'confcde_vir', 'fr'),
