(6, '<img src=\\"http://www.from-us.com/images/bann.jpg\\" width=\\"700\\" height=\\"89\\" />\r\n<br />\\r\\n\r\n<div style=\\"width:700px;\\">\\r\\n	\r\n<div style=\\"text-align: left;\\">\r\n<font face=\\"arial\\" size=\\''2\\''><b>%prenom% %nom%</b></font></div>\\r\\n	\r\n<div style=\\"text-align: justify;\\">\\r\\n	\r\n<font face=\\"arial\\" size=\\''2\\''>Votre demande de changement de mot de passe a bien &eacute;t&eacute; prise en compte. <br />\\r\\n\r\n    Afin de la valider d&eacute;finitivement, merci de bien vouloir noter votre mot de passe provisoir :\\r\\n\r\n    %motdepasse%\\r\\n\r\n    <BR />\\r\\n	\r\nCe mot de passe vous permettra de vous connecter au site internet et vous pourrez si vous le désirez, changer votre mot de passe.\\n \r\n    En cas de soucis de connexion &grave; votre compte, vous pouvez nous joindre au XX XX XX XX XX<br />\\r\\n\r\n</font>\\r\\n \r\n</div>\\r\\n\r\n<br />\\r\\n\r\n<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''>Pour toute questions ou toute aide sur les services offerts ainsi que sur le site, merci de contacter par email notre service technique dans la rubrique <a href=\\''http://www.from-us.com/contact.html\\''>CONTACT</a> en indiquant vos Nom, Pr&eacute;nom et adresse Email afin que nos services puissent traiter votre question dans les plus brefs d&eacute;lais.</font></div><br />\\r\\n	<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''><b>IMPORTANT:</b> Si vous ne vous &ecirc;tes jamais enregistr&eacute;(e) sur notre site internet, merci de nous contacter en pr&eacute;cisant qu\\''une personne, par erreur ou de fa&ccedil;on mal attentionn&eacute;e, a usurp&eacute; votre identit&eacute; au <b>XX.XX.XX.XX.XX</b></font></div>\\r\\n	<br />\\r\\n	<br />\\r\\n	<div style=\\"text-align: justify;\\"><font face=\\"arial\\" size=\\''2\\''>Nous vous remercions d\\''avoir choisi from-US.com, en esp&eacute;rant vous revoir prochainement sur notre site.<br />\\r\\n	<a href=\\"