INSERT INTO `faq` (`faq_id`, `faq_date`, `faq_question`, `faq_reponse`, `faq_lien`, `faq_lang`, `faq_cat`) VALUES
(3, 1353489338, 'Que siginifie les termes employés sur le site ?', '<p><strong>VAT</strong> : repr&eacute;sente la TVA sur un produit. La TVA est calcul&eacute; sur le prix d''achat de l''article en ajoutant le transport du produit.</p>\r\n<p><strong>Custom Fees</strong> : Les "Custom fees" repr&eacute;sente une taxe de douane. Cette taxe est calcul&eacute;e sur la nature du produit et varie en fonction du pays importateur.</p>\r\n<p><strong>FOB</strong> : Free On board - On dit qu''une marchandise est achet&eacute;e ou vendue <em>FOB</em> quand celle-ci est achet&eacute;e sans les frais de transport et autres frais et taxes y aff&eacute;rant et sans les assurances&nbsp;pour cette marchandise.</p>\r\n<p><strong>DDP</strong> : &nbsp;Delivered Duty Paid - le vendeur paye tous les co&ucirc;ts de transport et supporte tous les risques jusqu''&agrave; ce que les marchandises soient d&eacute;charg&eacute;es, et paye de plus les taxes.</p>', 'TERMES', 'fr', 9),
(4, 1353490391, 'Comment calcule t-on un prix sur From-Us.com ?', '<p>Sur le site From-US.com, nos prix sont calcul&eacute;s selon des bar&ecirc;mes pr&eacute;cis.</p>\r\n<p>Vous commandez un produit sur un site partenaire de From-Us.com ou sur tout autre site.</p>\r\n<p>Le prix demand&eacute; est celui pay&eacute; en FOB.</p>\r\n<p>Ensuite, nous calculons le prix de transport en fonction de chaques marchandises. Ce prix d&eacute;pend du poids et de la cat&eacute;gorie de produits.</p>\r\n<p>Le prix final est ensuite estim&eacute; en fonction des taxes et TVA du pays importateur auquel nous ajoutons un service de gestion de la commande et &eacute;ventuellement une assurance sur le produit.</p>\r\n<p><strong>EXEMPLES :</strong></p>\r\n<p>Je commande un <strong>manteau de fourrure</strong> &agrave; <strong>1000 USD</strong> sur un site partenaire. Je suis un client <strong>Fran&ccedil;ais</strong> et j''ai l''offre <strong>PREMIUM</strong>. Je souhaite une livraison via <strong>AIR</strong>.</p>\r\n<p>Via la page de calcul en ligne,</p>\r\n<ul>\r\n<li>je s&eacute;lectionne le pays de destination : FRANCE</li>\r\n<li>Je s&eacute;lectionne l''offre : PREMIUM</li>\r\n<li>Je s&eacute;lectionne le mode de transport : AVION</li>\r\n<li>Puis je compl&egrave;te le formulaire :\r\n<ul>\r\n<li>Libell&eacute; du produit,</li>\r\n<li>Cat&eacute;gorie et sous-cat&eacute;gorie de celui-ci</li>\r\n<li>Dimensions (longueur, largeur, hauteur) et poids</li>\r\n<li>Quantit&eacute; et prix.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>La page apr&egrave;s validation va simuler le prix de transport et les frais de dossier de la commande.</p>\r\n<p>Une fois logu&eacute;, vous aurez un devis estimatif de ce que vous devrez payer pour l''achat de ce produit aux USA et son retour en France.</p>\r\n<ul>\r\n<li>Prix de la marchandise (FOB) : 1000 USD</li>\r\n<li>Frais de dossier From-US : 100 USD</li>\r\n<li>Prix de la livraison : 16.75 USD</li>\r\n<li>TVA Sur produit : 206.66 USD</li>\r\n<li>Custom Fees : 37.62 USD</li>\r\n<li>Prix total : 1361.03 USD</li>\r\n</ul>\r\n<p>En continuant l''op&eacute;ration, vous pourrez calculer le prix avec ou sans assurance de transport et valider votre demande.</p>\r\n<p>Je commande un&nbsp;<strong>IPAD </strong>&agrave;&nbsp;<strong>400 USD</strong>&nbsp;et un<strong> T-shirt</strong> &agrave; <strong>40 USD</strong> sur un site partenaire. Je suis un client <strong>Fran&ccedil;ais</strong> et j''ai l''offre <strong>PREMIUM</strong>. Je souhaite une livraison via <strong>AIR</strong>.</p>\r\n<p>Via la page de calcul en ligne,</p>\r\n<ul>\r\n<li>je s&eacute;lectionne le pays de destination : FRANCE</li>\r\n<li>Je s&eacute;lectionne l''offre : PREMIUM</li>\r\n<li>Je s&eacute;lectionne le mode de transport : AVION</li>\r\n<li>Puis je compl&egrave;te le formulaire :\r\n<ul>\r\n<li>Libell&eacute; des produit,</li>\r\n<li>Cat&eacute;gorie et sous-cat&eacute;gorie de ceux-ci</li>\r\n<li>Dimensions (longueur, largeur, hauteur) et poids pour chaque produit</li>\r\n<li>Quantit&eacute; et prix pour chaque produit.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>La page apr&egrave;s validation va simuler le prix de transport et les frais de dossier de la commande.</p>\r\n<p>Une fois logu&eacute;, vous aurez un devis estimatif de ce que vous devrez payer pour l''achat de ce produit aux USA et son retour en France.</p>\r\n<ul>\r\n<li>Prix de la marchandise (FOB) :&nbsp;440 USD</li>\r\n<li>Frais de dossier From-US :&nbsp;44 USD</li>\r\n<li>Prix de la livraison :&nbsp;33.5 USD</li>\r\n<li>TVA Sur produit : 92.81 USD</li>\r\n<li>Custom Fees :&nbsp;0 USD</li>\r\n<li>Prix total :&nbsp;610.31 USD</li>\r\n</ul>\r\n<p>En continuant l''op&eacute;ration, vous pourrez calculer le prix avec ou sans assurance de transport et valider votre demande.</p>\r\n', 'CALPRI', 'fr', 4),
(5, 1353490741, 'Quels sont les moyens de transports utilisé lors de la livraison d''un produit ?', '<p>Lors de la livraison d''un produit, vous avez le choix entre deux modes de transports entre USA et Europe :</p>\r\n<ul>\r\n<li><strong>MARITIME</strong> :</li>\r\n</ul>\r\n<p>Ce transport va vous permettre d''&eacute;conomiser de l''argent. En effet, la marchandise va &ecirc;tre consolid&eacute;e dans nos entrep&ocirc;ts am&eacute;ricains et envoy&eacute;e par Cargo vers votre destination de livraison. Attention cependant, le transport maritime s''adresse en g&eacute;n&eacute;ral &agrave; des clients peut presser et ayant achet&eacute; une marchandise encombrante et lourde (qui ne peut en g&eacute;n&eacute;ral pas entr&eacute;e dans une soute d''avion).</p>\r\n<ul>\r\n<li><strong>AERIEN</strong> :</li>\r\n</ul>\r\n<p>Le transport a&eacute;rien est le transport par d&eacute;faut pour rapatrier une marchandise en Europe. Plus rapide mais un peu plus on&eacute;reux, ce transport s''adresse principalement aux personnes plus press&eacute;s et n''ayant pas achet&eacute; une marchandise encombrante.</p>', 'LIVR', 'fr', 2);
