INSERT INTO `textes` (`texte_id`, `texte_libelle`, `texte_contenu`, `texte_lgue`, `texte_visible`) VALUES
(1, 'Edito', '<p>1. From-US.com est une soci&eacute;t&eacute; europ&eacute;enne, vous ouvrant les portes de tous les sites eShopping et eCommerce aux Etats Unis. Achetez &agrave; meilleurs prix, obtenez des discount plus importants, achetez des r&eacute;f&eacute;rences non existantes en Europe, nous nous occupons de tout jusqu''&agrave; la livraison &agrave; votre domicile.</p>', 'fr', 1),
(2, 'Edito', 'From-US.com is an European Company which is providing full access to all US eShopping and eCommerce WebSites. \r\nPurchase at better price, get higher discount, get none existing references and products in Europe, we take care of all with a full door to door delivery. ', 'en', 1),
(3, 'Use', 'Texte conditions d''utilisation', 'fr', 1),
(4, 'Use', '<p>Text of conditions of use</p>', 'en', 1),
(5, 'ML', '<p>Texte mentions l&eacute;gales</p>', 'fr', 1),
(6, 'ML', 'Text of legals', 'en', 1),
(7, 'Pay', 'Texte modalité de paiement', 'fr', 1),
(8, 'Pay', 'Terms of payment', 'en', 1),
(9, 'FRANCHISE', 'From-US.com vous int&eacute;resse, vous souhaitez devenir franchis&eacute; !! Compl&egrave;tez notre formulaire de demande, nous vous contacterons apr&egrave;s r&eacute;ception de la demande. ', 'fr', 1),
(10, 'FRANCHISE', 'From-US.com interest you, you want to become an affiliate!! Fill the form, we will contact you after demand reception.', 'en', 1),
(11, 'Calcul_online', 'Texte de calcul en ligne', 'fr', 1),
(12, 'Calcul_online', 'Text of online calculate', 'en', 1),
(13, 'DEJA_INSCRIT', 'Vous &ecirc;tes d&eacute;j&agrave; inscrit sur le site from-us.com. Si vous avez perdu vos idenfiant de connexion, <a href=\\"oubli_mot_passe.html\\">cliquez sur le lien pour que nos services vous les renvois. \r\n</a>', 'fr', 1),
(14, 'DEJA_INSCRIT', 'You are already register on from-us.com. If you loose your registration logs, <a href=\\"oubli_mot_passe.html\\">click here in order to our services send it by mail \r\n</a>\r\n', 'en', 1),
(15, 'ACTIVE', 'Votre compte a bien &eacute;t&eacute; activ&eacute;. Vous pouvez d&eacute;sormais profiter des services de from-us.com. Merci de votre confiance et bons achats.', 'fr', 1),
(16, 'ACTIVE', 'Your account has been activated. Now you can enjoy services from-us.com. Thank you for your trust and good shopping.', 'en', 1),
(17, 'ERREUR_ACTIVE', 'Votre code d''activation est erron&eacute;.<a href=''contact.html''>Veuillez contacter le service client pour que l''on proc&egrave;de &agrave; une activation manuelle de votre compte</a>. En pr&eacute;cisant votre nom, votre pr&eacute;nom et vos coordonn&eacute;es.', 'fr', 1),
(18, 'ERREUR_ACTIVE', 'Your activation code is wrong. <a href=''contact_us.html''> Please contact customer service for you makes manual activation of your account </ a>. Stating your name, your name and contact information.', 'en', 1),
(19, 'APV', 'La rubrique "acheter pour moi" vous permet de commander sans stress aux USA. Vous passez commande et les services de From-US.com s''occupe de tout... A chaque commande, vous pouvez visualiser les &eacute;tapes d''avancement. Apr&egrave;s validation de votre commande, cliquez sur le lien "Voir l''&eacute;tat de ma commande" pour voir le total de commandes et compl&eacute;ter le processus de confirmation et de v&eacute;rification de votre commande. \n<br /><br />\nSi vous ne voulez pas terminer votre commande, ce n''est pas un probl&egrave;me. Vous pouvez simplement cliquer sur "annuler ma commande".\n<br /><br />\nUne fois que vous avez confirm&eacute; votre commande "acheter pour moi", vous n''avez rien &agrave; faire d''autre!! Les repr&eacute;sentants de l''&eacute;quipe d''achat s''occuperont du reste. Ils termineront la commande pour vous et suivront sa piste jusqu''&agrave; ce qu''elle soit livr&eacute;e et mis &agrave; jour sur votre compte. A chaque &eacute;tape, vous serez averti par email.', 'fr', 1),
(20, 'APV', 'The "buy for me" allows you to control stress-free in the USA. You order and Services From-US.com take care of everything ... For each order, you can view the stages of completion. After confirmation of your order, click on the link "View eacute; tat my order" to see the total order and complete the process of confirmation and verification of your order.\n<br /><br />\nIf you do not complete your order, it is not a problem. You can simply click on "cancel my order".<br /><br />\n\nOnce you have confirmed your order "buy for me," you have nothing else to do! Representatives of the purchasing team will do the rest. They will complete the command for you and follow the trail until it is delivered and updated your account. At each step, you will be notified by email.', 'en', 1),
(21, 'APV_1', 'Afin de vous facilitez les calculs, from-us.com vous permet d''entrer les prix de vos articles. Les prix doivent tenir compte de la taxe de vente aux USA (si appliquable). Les co&ucirc;ts de livraison nationaux, les frais de cartes de cr&eacute;dit et la commission "Acheter Pour moi" seront ajout&eacute; automatiquement &agrave; votre commande. <br /> <br /> Le co&ucirc;t de livraison repr&eacute;sente le montant de la livraison du vendeur jusqu''&agrave; notre entrep&ocirc;t aux USA. <br />\r\nLes frais de carte de cr&eacute;dit sont de 4.5% factur&eacute;s sur toutes commandes "acheter pour moi" pay&eacute;es par carte de cr&eacute;dit.<br />\r\nLes frais de commission "acheter pour moi" sont de 15% pour les membres Open ou Silver et de 10% pour les membres Premium. C''est le porcentage sur la commande totale (sous-total + taxes de vente + frais nationaux de livraison).', 'fr', 1),
(22, 'APV_1', 'So you facilitate the calculations from-us.com allows you to enter the price of your items. Prices should reflect the sales tax in the U.S. (if applicable). National delivery costs, fees and credit card commission "Buy For Me" will be automatically added to your order. <br /> <br /> The shipping cost is the amount of the Seller''s delivery to our warehouse in USA. <br />\nFees credit card are charged 4.5% on all orders "buy for me" paid by credit card. <br />\nCommission fees "buy for me" are 15% Open or Silver members and 10% for Premium Members. This is the porcentage on the order total (subtotal + sales tax + shipping domestic delivery).', 'en', 1),
(23, 'APV_2', 'Une fois que le calcul du prix de votre commande est effectu&eacute;, vous recevez une notification par email. G&eacute;n&eacute;ralement, le temps de r&eacute;ponse pour les commandes "achetez pour moi" est de 24-48 heures ouvr&eacute;s apr&egrave;s acceptation du devis fourni par From-US.com.', 'fr', 1),
(24, 'APV_2', '\r\nOnce the calculation of the price of your order is completed, you will receive an email notification. Generally, the response time for orders "buy for me" is working 24-48 hours after acceptance of the quote provided by From-US.com.', 'en', 1),
(25, 'BANNED', 'Dans cette rubrique d&eacute;couvrez les produits interdits à l''import dans votre pays. Cliquez sur le drapeau de votre pays pour visualiser ceux-ci.', 'fr', 1),
(26, 'BANNED', 'In this part, see the banned products to the import into your state. Click on the flag to see it.', 'en', 1),
(27, 'BANNED', '', 'de', 1),
(28, 'CLAIM', 'Le service ne vous plait pas, vous rencontrez des difficult&eacute;s (colis non re&ccedil;u, abim&eacute;...), remplissez le formulaire pour nous signaler votre m&eacute;contentement, nous vous r&eacute;pondrons dans les plus brefs d&eacute;lais...', 'fr', 1),
(29, 'CLAIM', 'The service does not suit you, you encounter difficulties (parcel not received, damaged ...), fill out the form to notify us of your dissatisfaction, we will reply as soon as possible ...', 'en', 1),
(30, 'CLAIM', 'Der Dienst nicht zusagt, k&ouml;nnen Sie Schwierigkeiten (Paket nicht erhalten, besch&auml;digt ...) auftreten, f&uuml;llen Sie das Formular aus, um uns Ihre Unzufriedenheit mitteilen, werden wir so bald wie m&ouml;glich antworten ...', 'de', 1),
(31, 'CLAIM_AND', 'Dans tous les cas, nous vous offrons la r&eacute;exp&eacute;dition des marchandises et nous demandons l''&eacute;change de celles-ci GRATUITEMENT.\r\n<br />\r\nSi les marchandises sont endommag&eacute;es lors de la livraison, From-us.com ouvrira une r&eacute;clamation aupr&egrave;s du partenaire logistique en cause. ', 'fr', 1),
(32, 'CLAIM_AND', 'In all cases, we offer to re-export them and ask for exchange for FREE\r\n<br />\r\nIf items is damaged on delivery, From-US.com opens a claim against Logistic Group', 'en', 1),
(33, 'CLAIM_AND', 'In allen F&auml;llen bieten wir re-exportieren, und sie fragen zum Austausch kostenlos\r\n<br />\r\nWenn Elemente auf Lieferung besch&auml;digt ist, &ouml;ffnet From-US.com einen Anspruch gegen Logistic Group.', 'de', 1),
(34, 'CLAIM_NOR', 'Si les articles ne fonctionnement pas ET/OU ne sont pas les bons articles ET/OU il manque un colis, nous organisons la r&eacute;exp&eacute;dition pour &eacute;change pour un montant de XX USD\r\n<br />\r\nSi les marchandises sont endommag&eacute;es lors de la livraison, nous organisons la r&eacute;exp&eacute;dition GRATUITEMENT et From-US.com ouvrira une r&eacute;clamation aupr&egrave;s du transporteur. ', 'fr', 1),
(35, 'CLAIM_NOR', 'If items does not works, wrong item or missing items, then we can organize to re-export for exchange for a fee of XX USD<br />\r\nIf items is damaged on delivery, we can organize to re-export for FREE. From-US.com opens a claim against Logistic Group.', 'en', 1),
(36, 'CLAIM_NOR', 'Wenn Elemente nicht funktioniert hat, falsche Ware oder fehlen, dann k&ouml;nnen wir wieder den Export f&uuml;r den Austausch gegen eine Geb&uuml;hr von XX USD organisieren <br />\r\nWenn Elemente Lieferung besch&auml;digt ist, k&ouml;nnen wir organisieren GRATIS re-exportieren. From-US.com &ouml;ffnet ein Anspruch gegen Logistic Group.', 'de', 1),
(37, 'AFFILIATE', '<h2>Vous &ecirc;tes un distributeur</h2>\r\nVous souhaitez pouvoir exporter/importer librement vers l''Europe ou les USA. Rejoignez notre programme d''affiliation et b&eacute;n&eacute;ficiez d&egrave;s aujourdh''hui de nombreux avantages :\r\n<br />\r\n<div style="width:100%;float:left">\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_1.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />R&eacute;duction sur les livraisons internationales.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_3.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Suivez vos acheteurs en ligne.</div>\r\n    </div>\r\n</div>\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_2.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Liens et publicit&eacute;s sur notre site From-US.com.</div>\r\n    </div>\r\n</div>\r\n</div>\r\n\r\n<h2>Vous &ecirc;tes un partenaire</h2>\r\nVous souhaitez acheter aux USA pour un panel de consommateurs ou pour une client&egrave;le vaste... Inscrivez vous et d&eacute;couvrez nos avantages :\r\n<br />\r\n<div style="width:100%;float:left">\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_4.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Pas d''inscriptions, pas de frais mensuels.<br />Pas de cr&eacute;ations de comptes pour vos acheteurs.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_6.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Un service de protection contre les fraudes GRATUIT.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_8.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Priorit&eacute; sur l''&eacute;tablissement des factures et des livraisons quittant l''entrep&ocirc;t.</div>\r\n    </div>\r\n</div>\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_5.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Etablissement des labellelisations et documents pour l''export international.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_7.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Une v&eacute;rification des Carte de cr&eacute;dit.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_9.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Les commandes sont livr&eacute;es GRATUITEMENT &agrave; nos entrep&ocirc;ts am&eacute;ricains</div>\r\n    </div>\r\n</div>\r\n</div>\r\n', 'fr', 1),
(38, 'AFFILIATE', '<h2>You are Online Retailers</h2>\r\nYou want to export / import freely to Europe or the USA. Join our affiliate program and benefit today from many advantages:\r\n<br />\r\n<div style="width:100%;float:left">\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_1.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Discount on International shipments.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_3.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Personnal affiliate access to track your referrals.</div>\r\n    </div>\r\n</div>\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_2.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Ads and links on our website.</div>\r\n    </div>\r\n</div>\r\n</div>\r\n\r\n<h2>You are a partner</h2>\r\nYou want to buy in the USA for a consumer panel or a large customers service... Sign up and discover our advantages:\r\n<br />\r\n<div style="width:100%;float:left">\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_4.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />No registration and monthly fees.<br />No registration for your customers.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_6.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />FREE fraud protection services.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_8.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Billing and shippings prior to packages leaving our warehouse.</div>\r\n    </div>\r\n</div>\r\n<div style="width:49%;float:left">\r\n	<div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_5.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Establishment of labellelisations and documents for international export .</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_7.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Credit card verification.</div>\r\n    </div>\r\n    <div style="width:100%;float:left">\r\n    	<div style="width:30%;float:left;"><img src="./images/aff/aff_9.png"></div>\r\n        <div style="width:70%;float:left;"><br /><br />Orders are delivered FREE to our U.S. warehouses.</div>\r\n    </div>\r\n</div>\r\n</div>\r\n', 'en', 1),
(39, 'TRACKING', 'Dans cette partie, vous pouvez suivre vos commandes en cours et voir o&uacute; se trouve votre colis.', 'fr', 1),
(40, 'TRACKING', 'In this section, you can track your orders and see where your parcel.', 'en', 1),
(41, 'TRACKING_B', 'Suivez les colis partis de nos entrepots jusqu''&agrave; votre domicile.', 'fr', 1),
(42, 'TRACKING_B', 'Follow the package left our warehouse to your home.', 'en', 1),
(43, 'TRANSIT', 'Tous les d&eacute;lais de livraison sont calcul&eacute; des entrep&ocirc;ts de From-US.com aux Etats-Unis &agrave; l''a&eacute;roport de la ville not&eacute;e. <br />Des jours suppl&eacute;mentaires peuvent s''appliquer &agrave; des zones en dehors de ces villes.\r\n<br /><br />\r\n- Courier Express  = DHL Express or FedEx Priority <br />\r\n- Courier Standard = FedEx Standard or USPS GXG<br />\r\n- Airmail Express   = USPS Express Mail<br /> \r\n- Airmail Standard  = USPS Priority Mail\r\n', 'fr', 1),
(44, 'TRANSIT', 'All transit times are from From-US.com in the USA to the airport in the City noted. <br />Additional days may apply to areas outside these Cities.\r\n\r\n<br /><br />\r\n- Courier Express  = DHL Express or FedEx Priority <br />\r\n- Courier Standard = FedEx Standard or USPS GXG<br />\r\n- Airmail Express   = USPS Express Mail<br /> \r\n- Airmail Standard  = USPS Priority Mail', 'en', 1),
(45, 'CHAT', 'Vous rencontrez un probl&egrave;me, vous avez d&eacute;j&agrave; consult&eacute; la <a href="faq.html">FAQ</a>. Posez votre question, un conseiller vous &eacute;coute et vous r&eacute;pond. ', 'fr', 1),
(46, 'CHAT', 'You encounter a problem, you have already seen the <a href="faq.html"> FAQ </a>. Ask a question, a counselor listens and responds.', 'en', 1),
(47, 'PARRAIN_R', 'Bonjour %prenom_d%,<br />\nJe t''invites &agrave; venir visiter ce site :</br />\n<a href="http://www.from-us.com">\nhttp://www.from-us.com</a>.\n<br />\nTu y trouveras tous les produits am&eacute;ricains que tu cherches depuis des mois!!\n\nBon surf \n%prenom% %nom%', 'fr', 1),
(48, 'PARRAIN_R', 'Dear %prenom_d%,<br />\r\nI''m invited to visit this site:</br />\r\n<a href="http://www.from-us.com">\r\nhttp://www.from-us.com</a>.\r\n<br />\r\nYou''ll find all the American products you are looking for months!\r\n\r\nGood search\r\n%prenom% %nom%', 'en', 1),
(49, 'PARRAIN', 'Bonjour %nom% %prenom%,\r\n\r\n<br />\r\nMerci encore et bravo d''avoir fait partager notre site internet From-us.com!!! <br />\r\nVotre nouveau filleul s''appelle %nom_d% %prenom_d% (%email_f%)<br />\r\n\r\nPour vous encourager &agrave; parler de nous, nous vous cr&eacute;diterons de 1000 points bonus &agrave; chaque nouvelle inscription d''un de vos filleuls. Ce cr&eacute;dit sera disponible lors de l''inscription de vos filleuls et pourra vous permettre de b&eacute;n&eacute;ficier d''une r&eacute;duction sur notre site !!! \r\n<br />\r\nMerci et &agrave; bient&ocirc;t sur from-us.com', 'fr', 1),
(50, 'PARRAIN', 'Hello% name%% surname%\r\n\r\n<br />\r\nThank you again and congratulations for having shared our website From-us.com! <br />\r\nYour new godson called %nom_d% %prenom_d% (%email_f%) <br />\r\n\r\nTo encourage you to talk to us, we will credit 1,000 bonus points each new registration of your referrals. This credit will be available at registration and your referrals will allow you to receive a discount on our website!\r\n<br />\r\nThank you and goodbye from on-us.com', 'en', 1),
(51, 'BANNI', 'Texte si banni', 'fr', 1),
(52, 'BANNI', 'Text if banned', 'en', 1),
(53, 'NOTIFIER', 'Attention, les notions de poids et tailles de votre colis sont importantes afin de calculer votre livraison. Si vous avez un doute sur la taille de votre futur colis, contactez nous ou consultez le site : <a href="http://www.sizeasy.com/">http://www.sizeasy.com/</a>. Si les dimensions ou le volume de votre marchandise sont inexactes, From-US.com se r&eacute;serve le droit de vous facturer la diff&eacute;rence (+/-).\r\n<br />\r\n<br />\r\nAttention, le stockage de votre coli est limit&eacute;. Si vous souhaitez que nous conservions votre colis dans nos entrep&ocirc;ts, le d&eacute;lai est de 30 jours. Ce stockage entre en vigueur d&egrave;s r&eacute;ception de vos colis (pour les transports Ultra Express et Express). Si au bout de 10 jours apr&egrave;s l''arriv&eacute;e en entrep&ocirc;ts de vos colis, vous n''avez pas demand&eacute; la livraison, le service de stockage vous sera factur&eacute; 80 USD par lignes de commande, puis 120 USD &agrave; partir de 20 jours. Au bout du d&eacute;lai l&eacute;gal de 30 jours, vos colis seront exp&eacute;di&eacute;s automatiquement.\r\n<br />\r\n<br />\r\nUn email vous sera automatiquement envoy&eacute; lorsque votre colis sera arriv&eacute; dans nos entrep&ocirc;ts. ', 'fr', 1),
(54, 'NOTIFIER', 'Attention, the concepts of size and weight of your package are important to calculate your delivery. If you have any doubt about the size of your future package, contact us or visit: <a href="http://www.sizeasy.com/"> http://www.sizeasy.com/</a>. If the size or volume of your goods are incorrect, From-US.com reserves the right to charge you the difference(+/-).\r\n<br />\r\n<br />\r\nAttention, Storage of your parcel is limited. If you want us to keep your package in our warehouse, the period is 30 days.\r\n<br />\r\n<br />\r\nAn email will be sent automatically when your package arrives in our warehouse. ', 'en', 1),
(55, 'EXPLI_DELI', '<h2>Commandez et faites vous livrer dans nos entrepots</h2>\n<p>Vous souhaitez un produit sp&eacute;cifique au USA, commandez d&egrave;s maintenant celui-ci. Le colis est exp&eacute;di&eacute; &agrave; nos entrep&ocirc;ts vers votre suite unique. </p>\n<h2>Votre produit est ensuite pris en compte par nos &eacute;quipes</h2><p>\nVotre produit une fois livr&eacute; &agrave; notre entrep&ocirc;t est v&eacute;rifi&eacute;, photographi&eacute; et comparez avec la facture original. Toutes les &eacute;tapes sont suivis dans votre espace client.</p>\n<h2>Choisissez ensuite votre mode de livraison</h2>\n<p>Choisissez votre livraison : \n - Ultra express, \n - Express\nOU \n - Consolid&eacute;\n\nPuis votre paquet est transmis au transporteur a&eacute;rien ou maritime.</p>\n<h2>From-Us.com s''occupe de tout</h2>\n<p>Votre colis est ensuite dédouan&eacute; en transit et transmis chez vous par transporteur.</p>', 'fr', 1),
(56, 'EXPLI_DELI', '<h2> Order and have it delivered to our warehouses</h2>\n<p>You want a specific product to USA, order it now. The package is shipped to our warehouse to your suite unique.</p>\n<h2>Your product is then taken into account by our teams</h2>\n<p>Once your product delivered to our warehouse is checked, photographed and compare with the original invoice. All steps are followed in your account.</p>\n<h2>Then select your shipping method</h2>\n<p>Choose your delivery:\n  - Ultra Express\n  - Express\nOR\n  - Consolidated\n\nThen your packet is transmitted to the air carrier or sea.</p>\n<h2>From-Us.com takes care of everything</h2>\n<p>Your package is in transit then cleared and sent to you by courier.</p>', 'en', 1),
(63, 'EXPLI_HIW', '<h2>Obtenez votre boite aux lettres am&eacute;ricaine</h2><p>Commander aux USA peut par moment &ecirc;tre un vrai casse-t&ecirc;te : <br /> Carte bancaire refus&eacute;e ou livraison uniquement sur le territoire am&eacute;ricain... From-US.com vous permet de commander facilement aux USA. Comment ? Inscrivez vous sur notre site internet, obtenez une adresse postale am&eacute;ricaine puis commencez &agrave; acheter !\n</p>\n<h2>Commencez vos achats seul...</h2>\n<p>Achetez seul, surfez sur les sites internet am&eacute;ricains, choisissez vos produits, entrez comme adresse de livraison l''adresse US obtenu sur notre site puis notifiez votre achat! A l''arriv&eacute;e de votre coli dans nos locaux, payez et faites vous livrer.\n</p>\n<h2>Ou faites appel &agrave; notre service de mandatement d''achat </h2>\n<p>Si vous &ecirc;tes en difficult&eacute;s, passez commande sur notre site, From-US.com s''occupe de tout ! Commande, d&eacute;marches administratives, paiement... Votre colis chez vous sans soucis.</p>\n<h2>R&eacute;cup&eacute;rez ensuite vos achats directement chez vous</h2>\n<p>\nFaites vous ensuite livrez par air ou par mer, simplifiez vous vos d&eacute;marches, From-US.com d&eacute;douane vos colis, livre des USA vers l''Europe et s''occupe de tout.</p>', 'fr', 1),
(64, 'EXPLI_HIW', '<h2> Get your US address</h2><p>Order in the USA can at times be a real headache: <br /> Credit card declined or delivery only in the United States ... From-US.com allows you to easily order in the USA. How? Register on our website, get a U.S. mailing address and start buying!</p>\n<h2> Start shopping alone ... </h2>\n<p>Buy one, visit the U.S. websites, choose your product, enter the delivery address as U.S. address obtained on our website and notify your purchase! Upon the arrival of your parcel in our office, pay and do you deliver.</p>\n<h2> Or remember our service mandating purchase </h2>\n<p>If you are in difficulty, place an order on our website, From-US.com take care of everything! Control, administrative procedures, payment ... Your package to you without worries.</p>\n<h2> Then get your purchases directly to you </h2>\n<p>Do you then deliver by air or by sea, you simplify your efforts, From-US.com clears your package, book the USA to Europe and takes care of everything.</p>', 'en', 1),
(71, 'WELC_INSCR', 'Bonjour et bienvenue sur notre site internet From-us.com. Vous &ecirc;tes ici car vous recherchez un produit am&eacute;ricain que vous ne trouvez pas dans votre pays. From-US.com a pour but de vous aider &agrave; commander cet article sur internet et &agrave; vous faciliter la livraison. Voir avec PP pour la suite', 'fr', 1),
(72, 'WELC_INSCR', 'Hello and welcome to our website From-us.com. You are here because you are looking for an American product that you can not find your country. From-US.com aims to help you order this item on the internet and you facilitate delivery. PP to do with the following', 'en', 1),
(73, 'WELC_DEJA', 'Je suis deja inscrit et je presente les info de commencer a acheter et and ', 'fr', 1),
(74, 'WELC_DEJA', 'I''m already registered and I present the info to buy and start and', 'en', 1),
(75, 'INDEX_FUS', '<p>Vous souhaitez acheter un produit de la marque %marque% , connectez vous directement sur le site ou inscrivez vous ...<br /> From-US.com facilite vos achats et vous permets de : </p>\n<ul>\n<li>Faire des &eacute;conomies</li>\n<li>D&eacute;couvrir de nouveaux produits exclusifs aux USA</li>\n<li>Vous faire livrer n''importe o&ugrave; sans aucune autre intervention de votre part.</li>\n</ul>\n<p>Avec From-US.com, l''import devient plus facile....</p>', 'fr', 1),
(76, 'INDEX_FUS_A', '<p>Vous souhaitez acheter un produit: %marque% , connectez vous directement sur le site ou inscrivez vous ...<br /> From-US.com facilite vos achats et vous permets de : </p>\r\n<ul>\r\n<li>Faire des &eacute;conomies</li>\r\n<li>D&eacute;couvrir de nouveaux produits exclusifs aux USA</li>\r\n<li>Vous faire livrer n''importe o&ugrave; sans aucune autre intervention de votre part.</li>\r\n</ul>\r\n<p>Avec From-US.com, l''import devient plus facile....</p>', 'fr', 1);
